import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Amazon search input using placeholder attribute (different selector)
    const searchInput = await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type 'iPhone' into the search input
    await searchInput.click({ clickCount: 3 });
    await searchInput.fill('iPhone');

    // Wait for the search button using a different strategy: select the first visible .search-btn after the input
    const searchBtn = await page.$eval(
      'input[placeholder="Search Amazon"]',
      (input) => {
        // Find the next sibling button with class 'search-btn'
        let el = input.nextElementSibling;
        while (el) {
          if (el.classList && el.classList.contains('search-btn') && el.offsetParent !== null) {
            return el;
          }
          el = el.nextElementSibling;
        }
        // Fallback: find any visible .search-btn in the document
        const allBtns = Array.from(document.querySelectorAll('.search-btn'));
        return allBtns.find(btn => btn.offsetParent !== null);
      }
    );
    // Use page.evaluateHandle to get the button element
    const searchBtnHandle = await page.evaluateHandle(() => {
      const input = document.querySelector('input[placeholder="Search Amazon"]');
      let el = input && input.nextElementSibling;
      while (el) {
        if (el.classList && el.classList.contains('search-btn') && el.offsetParent !== null) {
          return el;
        }
        el = el.nextElementSibling;
      }
      // Fallback: find any visible .search-btn in the document
      const allBtns = Array.from(document.querySelectorAll('.search-btn'));
      return allBtns.find(btn => btn.offsetParent !== null) || null;
    });

    // Click the search button
    if (searchBtnHandle) {
      await searchBtnHandle.asElement().click();
    } else {
      throw new Error('Search button not found');
    }

    // Wait for the search results to appear (wait for h2 containing 'Search Results for')
    await page.waitForSelector('h2:has-text("Search Results for")', { timeout: 7000 });

    // Screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_search.png'));

    // Extract the number of results and product titles from the results page
    const resultsInfo = await page.$eval('.results-count', el => el.textContent.trim());
    const productTitles = await page.$$eval('.product-title', els => els.map(e => e.textContent.trim()));

    // Find if any product title contains 'iPhone'
    const foundIphone = productTitles.some(title => /iphone/i.test(title));

    return {
      success: true,
      action: "Searched for 'iPhone' products and verified search results appeared",
      extractedData: {
        resultsInfo,
        productTitles,
        foundIphone
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
